import React, { useEffect } from 'react'
import { useParams } from 'react-router-dom';

function Read() {
    const {id} = useParams();
    useEffect(() => {
        axios
          .get("http://localhost:8081/read/"+id)
          .then((res) => setData(res.data))
          .catch((err) => console.log(err));
      }, []);
  return (
    <div>Read</div>
  )
}

export default Read
